import React from 'react';
import './style.css'
import SecondBanner from './banner';

const index = () => {

    const meunome = "Gui";
    return (
        <div>
            <h1>Minha página inicial! :){meunome}

            </h1>

            <Banner descricao="Uma descricao"></Banner>
            <Banner descricao="Uma segunda descricao"></Banner>
            <Banner descricao="Uma terceira descricao"></Banner>
            <SecondBanner descricao="Uma descricao" nome="Nome QUalquer"></SecondBanner>


        </div>
    )
};

const Banner = (props) => {
    return (
        <h2>Aloha{
            props.descricao,
            props.nome
        }</h2>
    )
};

export default index;
